import React, { useState, useEffect } from 'react';
import { 
  Clapperboard, Code, Film, User, 
  Terminal, Brain, Camera, Laptop,
  Github, Linkedin, Mail
} from 'lucide-react';

const ProjectCard = ({ title, description, tags, image }) => (
  <div className="section-card group cursor-pointer">
    <div className="relative overflow-hidden rounded-md mb-4 aspect-video bg-base-900">
      <div className="absolute inset-0 bg-gradient-to-t from-base-900 to-transparent z-10" />
      <img 
        src={image || "/api/placeholder/640/360"} 
        alt={title}
        className="object-cover w-full h-full group-hover:scale-105 transition-transform duration-500"
      />
    </div>
    <h3 className="text-xl font-semibold mb-2">{title}</h3>
    <p className="text-white/60 mb-4">{description}</p>
    <div className="flex flex-wrap gap-2">
      {tags.map((tag, i) => (
        <span 
          key={i} 
          className="px-2 py-1 rounded-full text-xs font-medium bg-white/5 text-white/60"
        >
          {tag}
        </span>
      ))}
    </div>
  </div>
);

const SocialLink = ({ icon: Icon, label, href }) => (
  <a 
    href={href}
    target="_blank"
    rel="noopener noreferrer"
    className="flex items-center gap-2 text-white/60 hover:text-white transition-colors"
  >
    <Icon size={20} />
    <span>{label}</span>
  </a>
);

const NavItem = ({ id, icon: Icon, label, active, onClick }) => (
  <button
    onClick={onClick}
    className="nav-link"
  >
    <Icon 
      size={20} 
      className={active ? 'text-white' : 'text-white/40'}
    />
    <span className="nav-tooltip">{label}</span>
    {active && (
      <div className="absolute left-0 top-1/2 -translate-y-1/2 w-1 h-8 bg-white rounded-r-full" />
    )}
  </button>
);

function App() {
  const [activeSection, setActiveSection] = useState('compositing');
  const [isScrolled, setIsScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const renderCompositingSection = () => (
    <div className="space-y-12">
      <div className="max-w-2xl">
        <h1 className="text-5xl font-bold gradient-text mb-6">Compositing & VFX</h1>
        <p className="text-xl text-white/60 leading-relaxed">
          Senior Compositor specialized in creating seamless visual effects using Nuke.
          Experienced in film production, advertising, and technical direction.
        </p>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <ProjectCard 
          title="Project Alpha"
          description="Lead compositor for major film production, managing complex VFX sequences."
          tags={['Nuke', 'Compositing', 'Film']}
        />
        <ProjectCard 
          title="Commercial Projects"
          description="High-end compositing for international advertising campaigns."
          tags={['Commercial', 'Advertising', 'Color Grading']}
        />
      </div>
    </div>
  );

  const renderTechnicalSection = () => (
    <div className="space-y-12">
      <div className="max-w-2xl">
        <h1 className="text-5xl font-bold gradient-text mb-6">Technical Direction</h1>
        <p className="text-xl text-white/60 leading-relaxed">
          Python development, pipeline optimization, and computer vision implementation.
          Focused on improving workflow efficiency and automation.
        </p>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <ProjectCard 
          title="Pipeline Tools"
          description="Custom Python tools for VFX pipeline optimization."
          tags={['Python', 'Pipeline', 'Automation']}
        />
        <ProjectCard 
          title="AI Integration"
          description="Computer vision models for automated tracking and rotoscoping."
          tags={['AI', 'Computer Vision', 'Machine Learning']}
        />
      </div>
    </div>
  );

  const renderContent = () => {
    switch (activeSection) {
      case 'compositing':
        return renderCompositingSection();
      case 'technical':
        return renderTechnicalSection();
      // Add other sections as needed
      default:
        return null;
    }
  };

  return (
    <div className="min-h-screen bg-base-black text-white">
      <nav className={`fixed top-0 left-0 w-20 h-screen bg-base-900/80 backdrop-blur-md border-r border-white/5 z-50 transition-all duration-300 ${
        isScrolled ? 'border-white/10' : ''
      }`}>
        <div className="flex flex-col items-center h-full py-8">
          <div className="text-2xl font-bold mb-12 font-mono">MT</div>
          <div className="flex flex-col gap-4">
            <NavItem 
              id="compositing" 
              icon={Clapperboard} 
              label="Compositing"
              active={activeSection === 'compositing'}
              onClick={() => setActiveSection('compositing')}
            />
            <NavItem 
              id="technical" 
              icon={Code} 
              label="Technical"
              active={activeSection === 'technical'}
              onClick={() => setActiveSection('technical')}
            />
            <NavItem 
              id="motion" 
              icon={Film} 
              label="Motion"
              active={activeSection === 'motion'}
              onClick={() => setActiveSection('motion')}
            />
            <NavItem 
              id="personal" 
              icon={User} 
              label="About"
              active={activeSection === 'personal'}
              onClick={() => setActiveSection('personal')}
            />
          </div>
          <div className="mt-auto flex flex-col gap-4">
            <SocialLink icon={Github} label="GitHub" href="#" />
            <SocialLink icon={Linkedin} label="LinkedIn" href="#" />
            <SocialLink icon={Mail} label="Email" href="mailto:contact@example.com" />
          </div>
        </div>
      </nav>
      <main className="ml-20 p-8">
        {renderContent()}
      </main>
    </div>
  );
}

export default App;
